import React from 'react';
import './DashboardHeader.css';
import jobTrackerBg from '../assets/jobTrackerBg.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser } from '@fortawesome/free-solid-svg-icons';

const DashboardHeader = ({ user, logOut }) => {
  const userImage = user?.picture ? (
    <img
      src={user.picture}
      alt="user"
      className="user-image"
      onError={(e) => {
        e.target.onerror = null;
        e.target.replaceWith(<FontAwesomeIcon icon={faUser} className="user-icon" />);
      }}
    />
  ) : (
    <FontAwesomeIcon icon={faUser} className="user-icon" />
  );

  return (
    <header className="dashboard-header">
      <img src={jobTrackerBg} alt="logo" className="logo" />
      <h1 className="dashboard-title">JobTrackr</h1>
      <div className="user-dropdown">
        <button onClick={() => logOut()} className="logout-btn">
          Log out
        </button>
        <div className="user-info">
          {userImage}
          <p>Name: {user.name}</p>
          <p>Email: {user.email}</p>
        </div>
      </div>
    </header>
  );
};

export default DashboardHeader;
